module Adm27Images (
    jpegTrefoil
  , jpegScissors
  , jpegTick
) where

import Graphics.PDF.Image (JpegFile,readJpegDataURL)

raw_trefoil :: String
raw_trefoil = "data:image/jpeg;base64,"

raw_scissors :: String
raw_scissors = "data:image/jpeg;base64,"

raw_tick :: String
raw_tick = "data:image/jpeg;base64,"

jpegDecode :: String -> JpegFile
jpegDecode url = jpegFile
               where Right jpegFile = readJpegDataURL url

jpegTrefoil :: JpegFile
jpegTrefoil = jpegDecode raw_trefoil

jpegScissors :: JpegFile
jpegScissors = jpegDecode raw_scissors

jpegTick :: JpegFile
jpegTick = jpegDecode raw_tick 